import React from "react";
import { Header, Footer } from "../components/mollecules";
import { AllProducts } from "../components/organismes";

function Shop() {
  const [search, setSearch] = useState("");

  const handleSearchChange = (value) => {
    setSearch(value);
  };

  return (
    <div>
      <Header.laptopHeader />
      <Header.FilterHeader />
      <AllProducts.Boutique />
      <Footer.laptopFooter />
    </div>
  );
}

export default Shop;
